import React, { useState } from 'react';
import Paper from '@mui/material/Paper';
import PersonIcon from '@mui/icons-material/Person';
import axios from 'axios';
import { Button, Icon, Link, TextField, Typography } from '@mui/material';

const LoginForm = () => {
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });

    function handleSubmit(event){
        const {name, value} = event.target;
        setFormData({...formData, [name]: value})
    }
    

   return(
        <form onSubmit={handleSubmit} className='loginFormContainer'>
            <Paper  elevation={20}></Paper>
                <div className='loginIcon'>
                    <PersonIcon fontSize='medium' color='primary'  />
                    <Typography variant='h5'>Login</Typography>
                </div>
                <div className='loginFields'>
                    <TextField label='Email Address' name='email' value={formData.email} type='text'></TextField>
                    <TextField label='Password' name='password' value={formData.password} type='password'></TextField>
                </div>
                <div className='loginButton'>
                    <Link label='Forgot Password'><Typography variant='body2'>Forgot Password</Typography></Link>
                    <Button type='submit' variant='contained' onClick={handleSubmit}>Login</Button>
                </div>
        </form>
   ) 
}

export default LoginForm;
